import TeacherClassSelect from "../TeacherClassSelect";
import "./style.css";

class CompleteProfile extends Component {
    state = {
        name: {
            firstName: "",
            lastName: ""
        },
        image: "",
        classroom: []
    }

    
    

    render() {
        return (
            <div className="container m-3" >
                
                <TeacherClassSelect />
            </div>
        )
    }
}

export default CompleteProfile;
